@Component({
  selector: 'app-root',
  template: `
  <main>
    <div class="header" >
      <img id="background" src="/assets/trolltunga2.png" alt="ono where image" aria-hidden="true">
      <img id="background" src="assets/
    </div>
    <div class="test">
      <img src="/assets/pasta.jpg" alt="ono where image" aria-hidden="true">
    </div>



  </main>  
  `,
  //templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'portfolio';
}
